            opacity: 0;
        }

        svg#freepik_stories-thesis.animated #freepik--Floor--inject-6 {
            animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) slideRight;
            animation-delay: 0s;
        }

        svg#freepik_stories-thesis.animated #freepik--Plant--inject-6 {
            animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) slideUp;
            animation-delay: 0s;
        }

        svg#freepik_stories-thesis.animated #freepik--Shadows--inject-6 {
            animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) zoomOut;
            animation-delay: 0s;
        }

        svg#freepik_stories-thesis.animated #freepik--light-bulb--inject-6 {
            animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) slideUp;
            animation-delay: 0s;
        }

        svg#freepik_stories-thesis.animated #freepik--Text--inject-6 {
            animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) slideDown;
            animation-delay: 0s;
        }

        svg#freepik_stories-thesis.animated #freepik--Gears--inject-6 {
            animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) slideUp;
            animation-delay: 0s;
        }

        svg#freepik_stories-thesis.animated #freepik--Thesis--inject-6 {
            animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) slideUp;
            animation-delay: 0s;
        }

        svg#freepik_stories-thesis.animated #freepik--magnifying-glass--inject-6 {
            animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) slideLeft;
            animation-delay: 0s;
        }

        svg#freepik_stories-thesis.animated #freepik--Pencil--inject-6 {
            animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) slideRight;
            animation-delay: 0s;
        }

        svg#freepik_stories-thesis.animated #freepik--Character--inject-6 {
            animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) zoomIn;
            animation-delay: 0s;
        }

        svg#freepik_stories-thesis.animated #freepik--note-2--inject-6 {
            animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) slideRight;
            animation-delay: 0s;
        }

        svg#freepik_stories-thesis.animated #freepik--note-1--inject-6 {
            animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) slideDown;
            animation-delay: 0s;
        }

        svg#freepik_stories-thesis.animated #freepik--speech-bubble--inject-6 {
            animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) zoomOut;
            animation-delay: 0s;
        }

        @keyframes slideRight {
            0% {
                opacity: 0;
                transform: translateX(30px);
            }

            100% {
                opacity: 1;
                transform: translateX(0);
            }
        }

        @keyframes slideUp {
            0% {
                opacity: 0;
                transform: translateY(30px);
            }

            100% {
                opacity: 1;
                transform: inherit;
            }
        }

        @keyframes zoomOut {
            0% {
                opacity: 0;
                transform: scale(1.5);
            }

            100% {
                opacity: 1;
                transform: scale(1);
            }
        }

        @keyframes slideDown {
            0% {
                opacity: 0;
                transform: translateY(-30px);
            }

            100% {
                opacity: 1;
                transform: translateY(0);
            }
        }

        @keyframes slideLeft {
            0% {
                opacity: 0;
                transform: translateX(-30px);
            }

            100% {
                opacity: 1;
                transform: translateX(0);
            }
        }

        @keyframes zoomIn {
            0% {
                opacity: 0;
                transform: scale(0.5);
            }

            100% {
                opacity: 1;
                transform: scale(1);
            }
        }
    </style>
